import  React ,{Component} from 'react';
import Pelicula from './Pelicula';


class  Peliculas extends Component {
    state = {
      
    };

    cambiarTitulo =  () => {
        var {peliculas} = this.state;
        var random = Math.floor(Math.random () * 3)
        peliculas[random].titulo = "joker parte1";

        this.setState ({

            peliculas: peliculas
        });
    }
    favorita =(pelicula, indice)=>{
        console.log("FAVORITA MARCADA")
        console.log(pelicula , indice);
        this.setState({
            favorita:pelicula
        })
    }
    
    componentWillMount(){
      // alert(' se va a mostrar el componente ');
        this.setState({

            
            peliculas:[ 
                {titulo : "joker",
                 image: "data:image/jpeg;base64,   "
            },
            {titulo : "termineitor",
             image: "data:image/jpeg;base64," ,
            },
            {
                titulo : "la mascara ",
                image: "https://i.pinimg.com/originals/1e/ce/95/1ece951da3520dd39794fc206af2dac3.jpg"
            },
            ],
            favorita : {}
        })
    }
    componentDidMount(){
       // alert ('ya se mostro el componente');
    }
   
    render (){
        var pStyle ={
            background : 'green',
            color: 'white',
            padding: '10px'
        }

        return(
            <div id = "content" className="peliculas ">
            <h2 className="subheader">peliculas </h2>
            <p> peliculas favoritas de fede</p>
            <p> 
                <button onClick={this.cambiarTitulo}>Cambiar titulo</button>
            </p>
            {
                this.state.favorita.titulo ? ( 
                <p className="favorita" style={pStyle}>
                
                <strong> la pelicula favorita es </strong>
                <span>{this.state.favorita.titulo}</span>
            </p>
                ) :(
                    <p>no hay pelicula favorita</p>
            )

            }
           
            {/**crear el componente de peliculas */}
            <div id =" articles"className="peliculas" >
            {
                this.state.peliculas.map((pelicula,i)=>{
                    return(
                        <Pelicula key={i} pelicula={pelicula}
                        indice={i}
                        marcarFavorita={this.favorita}
                        />

                    )
                })
            }
            </div>
        </div>
        )
    }
}

export default Peliculas;